tables.table_schema:
CREATE TABLE SoilSampleData (
  soil_sample_id UUID PRIMARY KEY,
  ph_level FLOAT,
  moisture_content FLOAT,
  nutrient_levels JSONB
);

CREATE TABLE AnalysisLog (
  analysis_id UUID PRIMARY KEY,
  sample_date TIMESTAMP,
  analyst_name TEXT,
  analysis_result TEXT
);

CREATE TABLE analysis_results (
    analysis_id UUID PRIMARY KEY,
    sample_id UUID REFERENCES soil_samples(sample_id),
    analysis_date TIMESTAMP,
    result_description VARCHAR(255)
);

CREATE TABLE comparisons (
    comparison_id UUID PRIMARY KEY,
    analysis_id UUID REFERENCES analysis_results(analysis_id),
    comparison_date TIMESTAMP,
    comparison_result VARCHAR(100)
);

CREATE TABLE Soil_Samples (
    sample_id INT PRIMARY KEY,
    pH_levels FLOAT,
    moisture_content FLOAT,
    nutrient_levels JSONB
);

CREATE TABLE Sample_Location (
    location_id INT PRIMARY KEY,
    sample_id INT REFERENCES Soil_Samples(sample_id),
    location TEXT
);

CREATE TABLE Sample_Timestamp (
    timestamp_id INT PRIMARY KEY,
    sample_id INT REFERENCES Soil_Samples(sample_id),
    timestamp TIMESTAMP
);

CREATE TABLE Sample_Analysis (
    analysis_id INT PRIMARY KEY,
    sample_id INT REFERENCES Soil_Samples(sample_id),
    analysis_type TEXT,
    analysis_result TEXT
);

CREATE TABLE SoilSamples (
    sample_id INT PRIMARY KEY,
    pH_level DECIMAL,
    moisture_content DECIMAL,
    nutrient_level DECIMAL
);

CREATE TABLE SampleLocations (
    location_id INT PRIMARY KEY,
    location_name VARCHAR(50)
);

CREATE TABLE Researchers (
    researcher_id INT PRIMARY KEY,
    researcher_name VARCHAR(50)
);

CREATE TABLE SampleAnalysis (
    analysis_id INT PRIMARY KEY,
    sample_id INT,
    researcher_id INT,
    analysis_date DATE
);

CREATE TABLE AnalysisResults (
    result_id INT PRIMARY KEY,
    analysis_id INT,
    parameter_name VARCHAR(50),
    value DECIMAL
);
